import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Soccer Registration</h1>
        <br />
        <Toolbar 
          adminPage={withAuthenticator(Admin)}
          playerPage={() => alert('Player Page!')}
        />
      </header>
    </div>
  );
}

function Toolbar({ adminPage, playerPage }) {
  return (
    <div>
      <Button onClick={adminPage}>
        Admin
      </Button>
      <Button onClick={playerPage}>
        Player
      </Button>
    </div>
  );
}

function Button({ onClick, children }) {
  return (
    <button onClick={onClick}>
      {children}
    </button>
  );
}

function Admin({ signOut }) {
  return (
    <View className="App">
      <Card>
        <Image src={logo} className="App-logo" alt="logo" />
        <Heading level={1}>We now have Auth!</Heading>
      </Card>
      <Button onClick={signOut}>Sign Out</Button>
    </View>
  );
}

export default App;
